import 'package:equatable/equatable.dart';import 'package:intex_mobile_app/core/models/Catalog_model.dart';class Order extends Equatable {  late final Catalog catalog;    int count;  String? name;  String? phone;  String? address;  String? order_number;  int? status_id;  Order({required this.catalog, this.count = 1});  Map<String, dynamic> toJson() => {        "name": name,        "phone": phone,        "address": address,        "order_number": order_number,        "status_id": status_id      };  @override  List<Object> get props => [catalog];}